%spark2
import org.apache.spark.sql.types._
import org.apache.spark.sql.DataFrame
import scala.collection.mutable.ListBuffer


//Note the location of the Data File - hdfs://HostWithNameNode:8020/tmp/MushroomDatabase.csv
//Create a data frame from CSV File 
val df_ornlData = sqlContext.read.format("com.databricks.spark.csv").option("header", "true").option("inferSchema", "true").load("/tmp/ornl_data/*.csv")

//Create Table from DataFrame
df_ornlData.createOrReplaceTempView("ornlWeather")

//Display resulting Infered schema 
df_ornlData.printSchema()

%spark2

import org.apache.spark.mllib.linalg.Vectors 

//Create a new feature vector to include a column for furure prediction 
val FPVector = FeatureVector.withColumn("prediction", expr("0")) 

//Cache Feature Vector to memory for performance 
FPVector.persist()

%spark2
import org.apache.spark.ml.clustering.KMeans

val NumberOfClusters = 5000

//Create the K-Means model
val kmeans = new KMeans().setK(NumberOfClusters).setFeaturesCol("features").setPredictionCol("predictions")

//Train the K-Means model with feature vector
val model = kmeans.fit(FPVector)

//Run data set against K-Means model and assign values
val Results = model.transform(FPVector)
Results.persist()

%spark2
import scala.collection.mutable.ListBuffer

//Find the number of events in each cluster
val clusterCount = model.getK

//Create iterator counter
var anomalyCount = 0;

//Create Anomaly List
val anomaly = new ListBuffer[DataFrame]()

//Count the number of events per cluster
for( a <- 0 until clusterCount) {
    val count = Results.filter("prediction = "+a.toString()).count()
    println("Cluster "+a.toString() + " count: "+count.toString()  )

    //Anomaly Detection 
    if(count == 1)
    {
      val anomalyDF = Results.filter("prediction = "+a.toString()).toDF()
      //print(anomalyString.show() ) 
      anomaly += anomalyDF
      anomalyCount+=1
   }
}
